import React from 'react';

const Article = (comment) => {
    return (
        <div>
            <div id='article-entete'>
                <h3>{comment.author}</h3>
                <p>{comment.date}</p>
            </div>

            <p>{comment.message}</p>
            <button>Modifier</button>
            <button>Supprimer</button>
        </div>
    );
};

export default Article;
